import logo from './logo.svg';
import './App.css';
import { Redirect, Route } from 'react-router';
import Welcome from './Components/Welcome/Welcome';

function App() {
  return (
    <div className="App">
        <Switch>
          <Route path="/" exact>
            <Redirect to="/Welcome" />
          </Route>

          <Route path="Welcome">
            <Welcome />
          </Route>
        </Switch>
    </div>
  );
}

export default App;
